import React from "react";
import Header from "../component/Header";
import ListView from "../component/ListView";
import ActionButton from "../component/ActionButton";

function Main() {
    return (
        <div id="content">
            <Header />
            <ListView />
            <ActionButton btnTitle="문장 추가하기"/>
        </div>
    )
}

export default Main;
